import React, { useState } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText
} from 'reactstrap';
// import axios from "axios";
import "./navbar.css";

const Navi = (props) => {
  const [collapsed, setCollapsed] = useState(true);
  const toggleNavbar = () => setCollapsed(!collapsed);

      return (
        <div>
        <Navbar>
          <Navbar.Brand href = ""><h1>Navbar</h1></Navbar.Brand>
          <NavbarToggler onClick={toggleNavbar} className="mr-2" />
        <Collapse isOpen={!collapsed} navbar>
          <Nav navbar>
            <NavItem>
              <NavLink href="/components/">Components</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="https://github.com/reactstrap/reactstrap">GitHub</NavLink>
            </NavItem>
          </Nav>
        </Collapse>

            {/* <Navbar.Toggle title="" id="collasible-nav-dropdown">
                <NavDropdown href="">Education</NavDropdown>
                <NavDropdown.Item href="">Work Experience</NavDropdown.Item>
                <NavDropdown.Item href="">Projects</NavDropdown.Item>
                <NavDropdown.Item href="">Interests</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="">Contact</NavDropdown.Item>
              </Navbar.Toggle> */}
          </Navbar>
          </div>
      )
} 
    
  export default Navi;
